import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { RootState } from '../store';
import postProductAction from '../postProductAction';

import Box from '@material-ui/core/Box';
import Grid from "@material-ui/core/Grid";
import ProductSample from '../json/products.json';



const product = ProductSample.product;
const description = ProductSample.description;
const figURL = ProductSample.figURL;
const release = ProductSample.release;
const region = ProductSample.region;

const calory = ProductSample.calory;
const protein = ProductSample.protein;
const lipid = ProductSample.lipid;
const carbonhydrates = ProductSample.carbonhydrates;
const sugar = ProductSample.sugar;
const fiber = ProductSample.fiber;
const scequiv = ProductSample.scequiv;

const allergy = ProductSample.allergy;
const price = ProductSample.price;

const headStyle = {
  fontSize: '25px',
};

const prodStyle = {
  frame: {
    border: '2px solid #000000',
  },
  figure: {
    height: '300px',
  },
  prodName: {
    fontSize: '15px',
  },
  prodDesc: {
    fontSize: '12px',
  },
  prodRelease: {
    fontSize: '10px',
  },
  prodRegion: {
    fontSize: '10px',
  },
  prodNutrition: {
    fontSize: '10px',
  }
};

const reasonStyle = {
  head: {
    fontSize: '20px',
  },
  item: {
    fontSize: '10px',
  }
};

const linkStyle = {
  fontSize: '15px',
  color: '#00f'
};

const RecommendProducts = (): JSX.Element => {

  const dispatch = useDispatch()
  const buttonAlert = () => {
    dispatch(postProductAction())
  }

  const state = useSelector((state: RootState) => state.postProductReducer)

  return (
    <div>
      <p style={headStyle}>あなたにオススメの商品は...</p>

      <p>Product Data List .</p>
      <button onClick={buttonAlert}>get product</button>

      <Grid container spacing={10}>
        <Grid item xs>
          <Grid container spacing={1} style={prodStyle.frame}>
            <Grid item xs={5}>
              <img src={state.figURL} style={prodStyle.figure} />
            </Grid>
            <Grid item xs={6}>
              <p style={prodStyle.prodName}>{state.prodName}</p>
              <p style={prodStyle.prodDesc}>{state.description}</p>
              <p style={prodStyle.prodRelease}>発売日 {state.date}</p>
              <p style={prodStyle.prodRegion}>販売地域 {state.region}</p>
              <p style={prodStyle.prodNutrition}>熱量：{state.calory} kcal　タンパク質：{state.protein} g</p>
              <p style={prodStyle.prodNutrition}>脂質：{state.lipid} g　炭水化物：{state.carbonhydrates} g</p>
              <p style={prodStyle.prodNutrition}>糖質：{state.sugar} g　食物繊維：{state.fiber} g</p>
              <p style={prodStyle.prodNutrition}>食塩相当量：{state.scequiv} g</p>
            </Grid>
          </Grid>
      </Grid>

      <Grid item xs>
        <p style={reasonStyle.head}>こんなあなたにオススメ！</p>
        <p style={reasonStyle.item}>・オススメ理由①</p>
        <p style={reasonStyle.item}>・オススメ理由②</p>
        <a style={linkStyle}>詳しく見る</a>
      </Grid>

      </Grid>

      <br />
      <label>{state.status}</label>
      <br />
      <label>{state.prodID}</label>
      <br />
      <label>{state.price}</label>
      <label>{state.allergy}</label>

    </div>
  );
}

export default RecommendProducts;
